 we have one of the finest superstars of the Sandalwood industry, Kiccha Sudeep. We loved how friendly, warm \u0026 an absolute delight he was. Right from eating with his hands to talking about his love to feed people, K Sudeep is truly the Badshah of the industry. \n\nIn this candid chat with Kamiya Jani, he talks about his journey as an actor and the differences between Bollywood and Sandalwood cinema. BTW, he has also invited Curly Tales to a cook-off at his home kitchen. Keep an eye out for this cook-off.\n\n00:00 - Introduction\n01:31- Talking About His Strict Diet \n02:42- Discussing His Love For Cooking \n03:24 - Blindfold Challenge \n04:50 - Sunday Brunch Begins \n06:00 - Staying In Mumbai Vs Bangalore \n06:23 - Talks About Travelling Abroad \n06:56 - Hates Travelling In Long Journey Flights \n08:27 - Bangalore's Slang Saga \n09:16 - Why Title Vikrant Rona?\n09:58 - About The Film Vikrant Rona \n10:35 - Bollywood Must Catch Up To South Films\n12:05 - Two Stars Guarantee A Hit Film?\n13:53 - Talks About Crazy Fan Moments \n16:14 - Aspired To Be A Pilot, A Police Officer, And A Cricketer.\n17:08 - 5 Second Fire \n18:39 - Hosting Big Boss 9 Kannada \n19:08 - Thank You Kiccha Sudeep\n\nCheck Out All The Sunday Brunch Episodes Here:    • Sunday Brunch With Stars by Kamiya Ja...  \n\n#sundaybrunch #curlytales #kicchasudeep #kamiyajani #foodandtravel #travel #foodie \n\nSubscribe to Curly Tales on YT ► http://bit.ly/CurlyTales\n\nOther Social Accounts:\nFollow us on Facebook ►http://bit.ly/2PEaDGT\nFollow us on Instagram ► http://bit.ly/2NQcckE\nFor more such stories ► http://bit.ly/2MM7yrk","commandRuns":[{"startIndex":613,"length":5,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBoQ040EGAciEwjUsaTFzOGKAxXO6aACHYwTOXI=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=ArwBqLP9JQI\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"ArwBqLP9JQI","continuePlayback":true,"startTimeSeconds":0,"watchEndpointSupportedO
